Hi everyone, 

I am trying to write inference code for the ONNX Mask RCNN model in C++. The model has 1 input [1, C, H, W] and it gives 4 outputs with dynamic shapes. 

- Bounding Boxes [-1, 4]
- Classes [-1]
- Scores [-1]
- Masks [-1, 1, -1, -1]

I managed to extract the information regarding bounding boxes, classes and scores. However I do not know how to deal with the mask output. It seems that the mask output is completely flatted (floatarr4), whereas I want an output something like [1, 1, H, W]. Below the code that I am using to extract the information. I hope someone can push me into the right direction
```
  /**************** Create ORT session ******************/
  Ort::SessionOptions sessionOptions;
  sessionOptions.AppendExecutionProvider_CUDA(OrtCUDAProviderOptions{});
  sessionOptions.SetGraphOptimizationLevel(GraphOptimizationLevel::ORT_ENABLE_ALL);
  mSession = std::make_shared<Ort::Session>(*mEnv, modelFilepath.c_str(), sessionOptions);

  /**************** Create allocator ******************/
  Ort::AllocatorWithDefaultOptions allocator;

  // Get the name of the output
  mOutputName1 = mSession->GetOutputName(0, allocator);
  mOutputName2 = mSession->GetOutputName(1, allocator);
  mOutputName3 = mSession->GetOutputName(2, allocator);
  mOutputName4 = mSession->GetOutputName(3, allocator);

  std::vector<const char*> inputNames{mInputName};
  std::vector<const char*> outputNames{mOutputName1, mOutputName2, mOutputName3, mOutputName4};

  std::vector<Ort::Value> outputTensors =  mSession->Run(Ort::RunOptions{nullptr}, inputNames.data(), inputTensors.data(), 1, outputNames.data(), 4); 

  // Get the inference result
  float* floatarr1 = outputTensors[0].GetTensorMutableData<float>();
  float* floatarr2 = outputTensors[1].GetTensorMutableData<float>();
  float* floatarr3 = outputTensors[2].GetTensorMutableData<float>();
  float* floatarr4 = outputTensors[3].GetTensorMutableData<float>();
  
